// src/components/Wishlist.jsx
import React from 'react';
import { useWishlist } from '../context/WishlistContext';
import '../styles/Wishlist.css'; // Import the CSS for styling

const Wishlist = () => {
  const { wishlist, removeFromWishlist } = useWishlist(); // Access wishlist and remove function

  return (
    <div className="wishlist-container">
      <h2>My Wishlist</h2>
      {wishlist.length === 0 ? (
        <p>Your wishlist is empty.</p>
      ) : (
        <ul className="wishlist-list">
          {wishlist.map((property) => (
            <li className="wishlist-item" key={property.id}>
              <h3>{property.title}</h3>
              <p>{property.location}</p>
              <p>${property.price.toLocaleString()}</p>
              <button className="remove-button" onClick={() => removeFromWishlist(property.id)}>Remove</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Wishlist;
